import React from 'react'
import { useDispatch } from 'react-redux';
import {playButtonfunc} from './redux/actionType'

const buttonPlayerStyle = {
  width: "50%",
  display: "flex",
  paddingTop: "100px",
  flexDirection: "column",
};


export default function ButtonPlayer() {
  const dispatch = useDispatch();


  return (
    <div style={buttonPlayerStyle}>
      {[...Array(3)].map((_, idx) => (
        <button key={idx}>Click{idx + 1}</button>
      ))}
    </div>
  );
}
